import React from "react";
import "./navbar.css";

const Navbar = props => {
  return (
    <div className="container">
      <h1 className="brand-logo">Gig Alert</h1>
      <ul className="nav nav-tabs">
        <li className="nav-item">
          <a href="/homes">Home</a>
        </li>
        <li className="nav-item">
          <a href="/bands">Bands</a>
        </li>
        <li className="nav-item">
          <a href="/musicians">Musicians</a>
        </li>
      </ul>
    </div>
  );
};
export default Navbar;
